INSERT INTO public."NewsFromBloodBank" ("Id", "title", "content", "apiKey", "newsStatus", "base64image", "bloodBankName") VALUES ('b2ea43a1-2d04-42c0-a82b-561956389e12', 'Advanced Diagnosis and Treatment of Rheumatoid Arthritis', 'Join us for an appointment with our skilled rheumatologist. Our expert will provide a thorough evaluation and develop a personalized treatment plan to alleviate your pain and improve your quality of life. Dont let arthritis or other rheumatic conditions control your life. Schedule your appointment today!', 'apiKey', 1, '', 'BloodBank');
INSERT INTO public."NewsFromBloodBank" ("Id", "title", "content", "apiKey", "newsStatus", "base64image", "bloodBankName") VALUES ('4024fb78-2cf2-46b0-ad66-c1eec879e3da', 'Take Control of Your Health: Schedule Your General Doctors Appointment Today', 'Dont neglect your health any longer. Schedule an appointment with one of our experienced doctors today. Our team will provide a comprehensive examination and work with you to develop a personalized treatment plan that addresses your specific needs.', 'apiKey', 1, '', 'BloodBank');
INSERT INTO public."NewsFromBloodBank" ("Id", "title", "content", "apiKey", "newsStatus", "base64image", "bloodBankName") VALUES ('6d21d91b-df73-4afa-aec3-b27fdc03ec9a', 'Act Fast: Limited Time Offer - Schedule Your Dental Appointment This Week', 'Dont let your oral health fall by the wayside. Take advantage of our special offer and schedule your dental appointment this week. Our experienced dentists will provide a thorough cleaning, examination and recommend any necessary treatments to ensure that you have a healthy and beautiful smile. Dont wait - book your appointment today before spots fill up! ', 'apiKey', 1, '', 'BloodBank');
INSERT INTO public."NewsFromBloodBank" ("Id", "title", "content", "apiKey", "newsStatus", "base64image", "bloodBankName") VALUES ('f7fbc190-a201-47c6-badc-27a4c6fbc6fa', 'Stock up on Essential Medicines: Exclusive Offer This Week Only!', 'Take advantage of our exclusive offer this week and stock up on essential medicines for you and your loved ones. We have a wide variety of over-the-counter and prescription medications available at discounted prices. Dont miss out on this limited-time opportunity to save on essential items for your health and well-being. Hurry in to our pharmacy today and take advantage of our special offer before it expires!', 'apiKey', 1, '', 'BloodBank');